import React from 'react';
import { useParams } from 'react-router-dom';

import Card from '../../shared/components/UIElements/Card';
import BigEvent from './bigEvent.jpg';
import EventItem from '../components/EventItem';
// Events is called in App.js where the route been defined
// @to-do
const Event = () => {
	const ID = useParams();
	const EVENTS = [
		{
			id: 'u1',
			name: 'Solo 1',
			title: 'Solo 1',
			image:
				'https://media.gettyimages.com/photos/san-jose-twilight-picture-id1058214402?s=2048x2048',
			address: 'Crows Landing',
			date: '06/25/2020',
			description: 'SCCA - San Francisco Region - Solo',
			coordinat: 'lat: 0 log: 0',
			courseMap:
				'https://www.bmwautocross.com/wp-content/uploads/2019/10/20191019-ggcautoxCourseMap-FINAL.png',
		},
		{
			id: 'u2',
			name: 'Solo 2',
			image: BigEvent,
			address: 'Crows Landing',
			date: '06/25/2020',
			description: 'SCCA - San Francisco Region - Solo',
			coordinat: 'lat: 0 log: 0',
			courseMap:
				'https://www.bmwautocross.com/wp-content/uploads/2019/10/20191019-ggcautoxCourseMap-FINAL.png',
		},
		{
			id: 'u3',
			name: 'Solo 3',
			image: `${process.env.PUBLIC_URL}/event.jpg`, // public folder
			address: 'Crows Landing',
			date: '06/25/2020',
			description: 'SCCA - San Francisco Region - Solo',
			coordinat: 'lat: 0 log: 0',
			courseMap:
				'https://www.bmwautocross.com/wp-content/uploads/2019/10/20191019-ggcautoxCourseMap-FINAL.png',
		},
	];
	const event = EVENTS.find(element => element.id === ID.id);
	if (event === undefined) {
		return (
			<div className="center">
				<Card>
					<h2>Not a valid event.</h2>
				</Card>
			</div>
		);
	}

	return <EventItem event={event} />;
};

export default Event;
